const measurementReducer = (state = initState, action) => {
    switch(action.type) {
        case 'ADD_MEASURE':
            console.log('added', action.measure);
            return state
        case 'ADD_MEASURE_ERROR':
            console.log('Add measure error', action.error);
            break;
        default:
            return state;
    }
}   

export default measurementReducer
